import React from "react";

import BlockContentTable from "./BlockContentTable";

import Divider from "@material-ui/core/Divider";
import Typography from "@material-ui/core/Typography";
import IconButton from "@material-ui/core/IconButton";
import { makeStyles } from "@material-ui/core/styles";

import CheckIcon from "@material-ui/icons/Check";
import CloseIcon from "@material-ui/icons/Close";
import { blue, green, red } from "@material-ui/core/colors";

import ButtonGroup from "@material-ui/core/ButtonGroup";

const useStyles = makeStyles({
  mainTitle: {
    fontWeight: "bold",
    paddingBottom: "40px",
  },
  title: {
    fontSize: 18,
    paddingBottom: "15px",
    fontWeight: "bold",
  },
  icon: {
    backgroundColor: blue,
  },
});

const Home = () => {
  const classes = useStyles();

  return (
    <div>
      <Typography variant="h6" className={classes.mainTitle} gutterButtom>
        THIS IS THE PERSONAL CONTRACT VIEW
      </Typography>
      <Typography variant="h6" className={classes.title} gutterButtom>
        THESE ARE THE BINARY CONTRACTS
      </Typography>
      <BlockContentTable />
      <Divider />
      <ButtonGroup>
        <IconButton color="secondary" aria-label="add an alarm">
          <CheckIcon style={{ color: "snow", backgroundColor: green[500] }} />
        </IconButton>
        <IconButton color="secondary" aria-label="add an alarm">
          <CloseIcon style={{ color: "snow", backgroundColor: red[500] }} />
        </IconButton>
      </ButtonGroup>
      <Typography variant="h6" className={classes.title} gutterButtom>
        THESE ARE YOUR REQUESTS
      </Typography>
      <BlockContentTable />
    </div>
  );
};

export default Home;
